import React from 'react';

import Header from './Header';
import Body from './Body';
import Footer from './Footer';

import './App.css';

class App extends React.Component {

	constructor(props) {
        super(props);
        this.state = {type: null, data: [{'name':null, 'age':null}]};
    }

	render() {
		return ( 
			<div> 
				<Header />
				<Body />
				<Footer />
			</div>
		);
	}
}
export default App;
